function timerInTest() {
  let sec = 0;
  let min = 0;

  setInterval(tick, 1000);

  function tick() {
    sec++;
    if (sec >= 60) {
      sec = 0;
      min++;
    }
    time = (min < 10 ? "0" + min : min) + ":" + (sec < 10 ? "0" + sec : sec);
    //console.log(time)
  }
}
